export interface HorasExtrasInngresa {
  identificacion: string;
  nombre: string;
  apellidos: string;
  horasExtras: HoraExtras[];
  totales: Totales;
}

export interface HoraExtras {
  dia: string;              // "2025-09-15"
  horasExtra: string;      // "01:30"
  editable: boolean;
  gestionado: boolean;
  revision: Revision;
}

export interface Revision {
  aprobadas: string;
  paraCompensar: string;
  pagadas: string;
  pagadas25: string;
  pagadas35: string;
  pagadas100: string;
  descartadas: string;
  observaciones: string;
  administrador: string;
}

export interface Totales {
  aprobadas: string;
  paraCompensar: string;
  pagadas: string;
  pagadas25: string;
  pagadas35: string;
  pagadas100: string;
  descartadas: string;
}

export interface HorasExtrasBuk {
  day?: number;
  month?: number;
  year?: number;
  hours?: number;
  id?: number;
  employeeId?: number;
  typeId?: number;
  centroCosto?: string;
  centroCostoCode?: string;
}

export interface HorasExtrasInngresaBuk extends HorasExtrasInngresa {
  horasExtrasBuk: HorasExtrasBuk[];
  pagadas25Buk?: number;
  pagadas35Buk?: number;
  pagadas100Buk?: number;
}

export interface Atrazo {
  day?: number;
  month?: number;
  year?: number;
  hours?: number;
  id?: number;
  employee_id?: number;
  type_id?: number;
}

export interface HorasNoTrabajadasRequest {
  employee_id: number;
  hours: number;
  year?: number;
  month?: number;
  // type_id se pone en el backend (si lo necesitas en front, agréguelo)
}

export interface HorasNoTrabajadasResponse {
  message?: string;
  ausencia?: HorasExtrasBuk;
}


export interface BatchItemResponse {
  employeeId: number;
  success: boolean;
  errorMessage?: string | null;
  response?: HorasNoTrabajadasResponse | null;
}

export interface BatchSummary {
  total: number;
  succeeded: number;
  failed: number;
  items: BatchItemResponse[];
}

